import React from 'react';
import { ScrollView, StyleSheet, Text, View, Image, TouchableOpacity } from 'react-native';

export default class PeopleDetailsPage extends React.Component{
  
  constructor (props) {
    super(props)
    const { info = {} } = props.route.params //erro aki
    console.log(info)
    this.state = {
      info: info || {}
    }
  }

  render(){
    return (
      <ScrollView>
      <View style={style.usuario}>

            <Text style={style.imagem}>
               <Text>Nome:</Text> </Text>
               {this.state.info.contato}
 
        </View> 
      </ScrollView>
    )
  }
  
}

const style = StyleSheet.create({ //add o css aki
  line: {
      height: 60,
      borderBottomWidth: 1,
      borderBottomColor: '#bbb',
      alignItems: 'center',
      flexDirection: 'row'
  },
  menu: {
    width: 425,
    height: 50,
    paddingTop: 15,
    fontSize: 15,
    textAlign: "center",
    color:'rgb(128, 128, 128);',
    backgroundColor:  'rgb(27, 212, 171);'
  },
  linetext:{
      fontSize:20,
      paddingLeft: 20,
      flex: 7
  },
  avatar:{
      aspectRatio: 1,
      flex: 1,
      marginLeft: 10,
      borderRadius: 50
  },
  imagem: {
    height: 250,
    width: 250,
    marginTop: 40,
    marginLeft: 60,
    marginRight: 80,
    marginBottom: 40,
    borderRadius: 600,
    backgroundColor: 'rgb(45, 52, 50)',
    aspectRatio: 1,
    alignItems: "center",
    textAlign: "center"
  },
  info: {
    fontSize: 20,
    marginBottom: 15,
    marginLeft: 15,
    marginRight: 15,
    paddingTop: 10,
    paddingLeft: 20,
    paddingBottom: 5,
    borderTopWidth: 1,
    borderTopColor: 'rgb(45, 52, 50);',
    borderBottomWidth: 1,
    borderBottomColor: ' rgb(45, 52, 50);',
    borderRightWidth: 1,
    borderRightColor: 'rgb(45, 52, 50);',
    borderLeftWidth: 1,
    borderLeftColor: 'rgb(45, 52, 50);',
    borderRadius: 20,
    color:'rgba(247, 247, 247, 0.891);',
    backgroundColor: 'rgb(102, 102, 102)'//item da lista de detalhes
  },
  botao: {
    marginTop: 25,
    marginBottom: 40,
    marginLeft: 110,
    marginRight: 110
  }
}
)
